import React, { useState, useEffect } from 'react';
import {
  Container,
  Row,
  Col,
  Card,
  CardBody,
  Spinner,
  Alert,
  Button
} from 'reactstrap';
import { LineChart, Line, BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer, Area, ComposedChart, Scatter } from 'recharts';
import { format, subYears } from 'date-fns';
import { api } from '../services/api';
import SummaryMetrics from '../components/Dashboard/SummaryMetrics';
import PriceChartWithEvents from '../components/Charts/PriceChartWithEvents';
import EventImpactChart from '../components/Charts/EventImpactChart';
import VolatilityChart from '../components/Charts/VolatilityChart';
import ChangePointTimeline from '../components/Charts/ChangePointTimeline';

const Dashboard = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [summaryData, setSummaryData] = useState(null);
  const [priceData, setPriceData] = useState([]);
  const [events, setEvents] = useState([]);
  const [changePoints, setChangePoints] = useState([]);
  const [selectedEvent, setSelectedEvent] = useState(null);
  const [filters, setFilters] = useState({
    startDate: format(subYears(new Date(), 5), 'yyyy-MM-dd'),
    endDate: format(new Date(), 'yyyy-MM-dd'),
    resolution: 'monthly'
  });

  useEffect(() => {
    fetchDashboardData();
  }, [filters]);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);

      // Fetch summary data
      const summary = await api.getAnalysisSummary();
      setSummaryData(summary.data);

      // Fetch price data
      const prices = await api.getPrices({
        start_date: filters.startDate,
        end_date: filters.endDate,
        resolution: filters.resolution
      });
      setPriceData(prices.data);

      // Fetch events
      const eventsData = await api.getEvents();
      setEvents(eventsData.data);

      // Fetch change points
      const cpData = await api.getChangePoints();
      setChangePoints(cpData.data.change_points);

      setLoading(false);
    } catch (err) {
      setError(err.message);
      setLoading(false);
    }
  };

  const handleEventSelect = async (event) => {
    try {
      setSelectedEvent(event);
      // Impact will be loaded by EventImpactChart component
    } catch (err) {
      console.error('Error selecting event:', err);
    }
  };

  if (loading) {
    return (
      <Container className="text-center py-5">
        <Spinner color="primary" />
        <p className="mt-3">Loading dashboard...</p>
      </Container>
    );
  }

  if (error) {
    return (
      <Container className="py-5">
        <Alert color="danger">
          <h4 className="alert-heading">Error Loading Dashboard</h4>
          <p>{error}</p>
          <Button color="danger" onClick={fetchDashboardData}>
            Retry
          </Button>
        </Alert>
      </Container>
    );
  }

  return (
    <div className="dashboard-page">
      <div className="page-header">
        <h1>Brent Oil Price Analysis Dashboard</h1>
        <p className="lead">Interactive analysis of geopolitical events and price dynamics</p>
      </div>

      <SummaryMetrics data={summaryData} />

      <Row className="mt-4">
        <Col lg={8}>
          <Card className="chart-card">
            <CardBody>
              <h5 className="card-title">Price History with Events</h5>
              <PriceChartWithEvents
                priceData={priceData}
                events={events}
                changePoints={changePoints}
                onEventSelect={handleEventSelect}
                height={400}
              />
            </CardBody>
          </Card>
        </Col>

        <Col lg={4}>
          <Card className="chart-card">
            <CardBody>
              <h5 className="card-title">Market Volatility</h5>
              <VolatilityChart height={400} />
            </CardBody>
          </Card>
        </Col>
      </Row>

      <Row className="mt-4">
        <Col lg={6}>
          <Card className="chart-card">
            <CardBody>
              <h5 className="card-title">Event Impact Analysis</h5>
              {selectedEvent ? (
                <EventImpactChart
                  event={selectedEvent}
                  height={300}
                />
              ) : (
                <div className="text-center py-5">
                  <p>Select an event from the chart to see impact analysis</p>
                </div>
              )}
            </CardBody>
          </Card>
        </Col>

        <Col lg={6}>
          <Card className="chart-card">
            <CardBody>
              <h5 className="card-title">Change Point Timeline</h5>
              <ChangePointTimeline
                changePoints={changePoints}
                height={300}
              />
            </CardBody>
          </Card>
        </Col>
      </Row>

      <Row className="mt-4">
        <Col md={12}>
          <Card>
            <CardBody>
              <h5 className="card-title">Key Insights</h5>
              <div className="insights-grid">
                {summaryData?.insights && Object.entries(summaryData.insights).map(([key, value]) => (
                  <div key={key} className="insight-item">
                    <div className="insight-label">{key.replace(/_/g, ' ')}</div>
                    <div className="insight-value">{value}</div>
                  </div>
                ))}
              </div>
            </CardBody>
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default Dashboard;
